import { CalendarEvent } from "../types";

// Initial event list
let eventList: CalendarEvent[] = [
  {
    id: "1",
    title: "Team Meeting",
    start: new Date("2024-09-20T09:00:00.000Z"),
    end: new Date("2024-09-20T10:00:00.000Z"),
    description: "Discuss project status",
    organizationId: "123"
  }
];

// Fetch events (returns a promise that resolves the eventList)
export function fetchEvents(): Promise<CalendarEvent[]> {
  return new Promise((resolve) => {
    resolve(eventList);
  });
}

// Create event (adds event to eventList and returns a resolved promise)
export function createEvent(event: Omit<CalendarEvent, 'id' | 'organizationId'>): Promise<CalendarEvent> {
  return new Promise((resolve) => {
    // Create a new event with a unique ID and add to the list

    console.log('event',event)
    const newEvent: CalendarEvent = {
      ...event,
      id: String(eventList.length + 1), // Generate a new id
      organizationId: "123"+ 1 // Assuming you add organizationId manually
    };
    // eventList.push(newEvent);
    console.log('eventList',eventList)
    resolve(newEvent);
  });
}

// Delete event (removes the event from eventList based on eventId)
export function deleteEvent(eventId: string): Promise<void> {
  return new Promise((resolve) => {
    eventList = eventList.filter((event) => event.id !== eventId);
    resolve();
  });
}
